import React from 'react';

function CartPage({ cartItems }) {
  return (
    <div>
      <h1>Your Cart</h1>
      <ul>
        {cartItems.map(item => (
          <li key={item.id}>
            {item.product.name} - {item.quantity}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default CartPage;
